import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
    <h1>JOBOT</h1>
    <p>
    This is the home page. Use the menu above to navigate to other pages.
    </p>
      <nav>
    <ul>
    <li>
        <Link to="/">Home</Link>
    </li>
    <li>
        <Link to="/about">About</Link>
    </li>
    <li>
        <Link to="/contact">Contact</Link>
    </li>
    </ul>
</nav>
    </div>
  );
}

export default Home;
